                            {item.dept== "CSE"? <p>301 302 205 105 106</p>: <p>303 304 103 104</p>}
                            {/*<p >{loggedstat} </p> <br/>*/}
                            
                        </div>
                </div>
            })}
        </div>
    </div>
  )
}

export default Userview
